def rise_or_down(df):
    df['rise_or_not']=np.where(df['PRC']-df['PRC'].shift(1)>0,1,-1)
def RSI(df):
    df['U']=np.where(df['rise_or_not']>0,df['PRC']-df['PRC'].shift(1),0)
    df['D']=np.where(df['rise_or_not']<0,df['PRC'].shift(1)-df['PRC'],0)
    df['RSI']=100*df['U'].rolling(14).apply(lambda x:exma(x))/(df['U'].rolling(14).apply(lambda x:exma(x))+df['D'].rolling(14).apply(lambda x:exma(x)))
def stochastic_oscillator(df):
    df['L14'] = df['BIDLO'].rolling(14).min()
    df['H14'] = df['ASKHI'].rolling(14).max()
    df['K'] = 100 * (df['PRC'] - df['L14']) / (df['H14'] - df['L14'])
def Williams_R(df):
    df['L14'] = df['BIDLO'].rolling(14).min()
    df['H14'] = df['ASKHI'].rolling(14).max()
    df['R'] = -100 * (df['H14'] - df['PRC']) / (df['H14'] - df['L14'])
def exma(array):
    ewa=0
    alpha=2/(len(array)+1)
    for i in range(0,len(array)):
        ewa=(1-alpha)*ewa+alpha*array[i]
    return ewa
def MACD(df):
    df['MACD']=df['PRC'].rolling(12).apply(lambda x:exma(x))-df['PRC'].rolling(26).apply(lambda x:exma(x))
def PROC(df):
    df['PROC']=(df['PRC']-df['PRC'].shift(14))/df['PRC'].shift(14)
def OBV(df):
    df['OBV_sign']=np.sign(df['PRC']-df['PRC'].shift(1))
    df['OBV_sing']=df['OBV_sign']*df['VOL']
    df['OBV']=df['OBV_sing'].cumsum()
