def quantiles(class_num):
    returns=[]
    for i in os.listdir('.\RF'):
        DF = pd.read_csv('D:\Formal\PythonCode\RF\\' + i, index_col=0)
        DF = DF.dropna(subset=['BIDLO','ASKHI','PRC','VOL'])
        DF['RET']=DF['RET'].apply(lambda x:0 if x=='B' or x=='C' else float(x))
        returns.append(DF['RET'].values)
    returns=reduce(lambda x,y:np.concatenate([x,y]),returns)
    returns=sorted(returns)
    points=[]
    part=len(returns)//class_num
    ind=0
    for i in range(0,class_num):
        points.append(returns[ind+part*i])
    points.append(returns[-1])
    return points

def label(x,points):
    label=len(points)
    for i in points:
        if i<x:
            label-=1
        else:
            break
    return label
def random_forest(DF,tree_num):
    X=DF[['RSI','K','R','MACD','PROC','OBV']].values
    Y=DF['label_fore'].values
    clf = RandomForestClassifier(n_estimators=tree_num, max_depth=10)
    clf.fit(X,Y)
    return clf
def train(class_num,tree_num,train_period,trade_period,end_date,trade_start_date,lors=True):
    trade_start=trade_start_date
    points=quantiles(class_num)
    for i in os.listdir('.\RF'):
        print(i)
