class daily_returns:
    def __init__(self,stocks,weights=None,cap=False):
        self.dates,self.series=plot_one(stocks,weights,cap)
        self.returns=[]
        self.max_daily_drawdown=[]
        self.max_drawdown=0
        self.kurtosis = 0
        self.volatility=0
        self.skewness=0
    def return_calc(self):
        for i in range(1,len(self.series)):
            self.returns.append(self.series[i]/self.series[i-1]-1)
    def kurtosis_calc(self):
        temp = np.array(self.returns)
        self.kurtosis = scipy.stats.kurtosis(temp)
    def skewness_calc(self):
        temp = np.array(self.returns)
        self.skewness = scipy.stats.skew(temp)
    def max_drawdown_calc(self):
        roll_max =[]
        for i in range(len(self.series)):
            if i <125:
                roll_max.append(max(self.series[:i+1]))
            else:
                roll_max.append(max(self.series[i-125:i]))
        drawdowns=self.series/np.array(roll_max)-1
        for i in range(len(drawdowns)):
            if i <125:
                self.max_daily_drawdown.append(min(drawdowns[:i+1]))
            else:
                self.max_daily_drawdown.append(min(drawdowns[i-125:i]))
        self.max_drawdown=min(drawdowns)
    def histogram(self):
        plt.hist(self.returns,bins=50,range=(-0.1,0.1))
        plt.xlabel('return')
        plt.show()
    def volatility_calc(self):
        temp = np.array(self.returns)
        self.volatility=np.std(temp)
    def show(self):
        print(self.max_drawdown,self.kurtosis, self.volatility, self.skewness)
