def plot_results(sets,kinds,labels):
    years = mdates.YearLocator()  # every year
    months = mdates.MonthLocator()  # every month
    yearsFmt = mdates.DateFormatter('%Y')

    fig, ax = plt.subplots()
    ind=0
    for i in sets:
        total_dates,total_series=i.dates,i.series
        ax.plot(total_dates, total_series, label=str(labels[ind])+kinds)
        ind+=1
    # format the ticks
    ax.xaxis.set_major_locator(years)
    ax.xaxis.set_major_formatter(yearsFmt)
    ax.xaxis.set_minor_locator(months)
    time_points = list(sets[0].dates)
    ax.set_xlim(time_points[0],time_points[-1])

    ax.format_xdata = mdates.DateFormatter('%Y-%m-%d')
    ax.format_ydata = lambda x: '$%1.2f' % x  # format the price.
    ax.grid(True)
    ax.legend()
    ax.set_ylabel('return')

    fig.autofmt_xdate()

    plt.show()

