def alpha_decay(lag):
    stocks = open('stocks.txt', 'r')
    odd = True
    stock_mem = {}
    for line in stocks.readlines():
        if odd:
            temp = line.strip().split(' ')[0]
            temp = datetime.datetime.strptime(temp, '%Y-%m-%d')
            odd = False
        else:
            odd = True
            stock_mem[temp] = re.sub("\[|\]|\'", '', line.strip())
            stock_mem[temp] = stock_mem[temp].split(',')
            for i in range(len(stock_mem[temp])):
                stock_mem[temp][i] = stock_mem[temp][i].strip()
    keys=list(stock_mem.keys())
    final={}
    for i in range(len(stock_mem.items())-lag):
        final[keys[i+lag]]=stock_mem[keys[i]]
    return final
